import React, { useState, useEffect } from 'react';
import logo from '../assets/MB.jpg'

const MensBasketballDashboard = () => {
  const [teamProfile, setTeamProfile] = useState(null);
  const [seasonalStats, setSeasonalStats] = useState(null);
  const [schedule, setSchedule] = useState(null);

  // Fetch team profile data
  useEffect(() => {
    fetch('http://localhost:3001/api/mens-basketball/team-profile')
      .then(response => response.json())
      .then(data => setTeamProfile(data))
      .catch(err => console.error('Error fetching team profile:', err));
  }, []);

  // Fetch seasonal stats data
  useEffect(() => {
    fetch('http://localhost:3001/api/mens-basketball/seasonal-stats')
      .then(response => response.json())
      .then(data => setSeasonalStats(data))
      .catch(err => console.error('Error fetching seasonal stats:', err));
  }, []);

  // Fetch schedule data
  useEffect(() => {
    fetch('http://localhost:3001/api/mens-basketball/schedule')
      .then(response => response.json())
      .then(data => setSchedule(data))
      .catch(err => console.error('Error fetching schedule:', err));
  }, []);

  // Show a loading state until all data is available
  if (!teamProfile || !seasonalStats || !schedule) {
    return <div>Loading...</div>;
  }

  // Render team-level stats as a table
  const renderTeamStatsTable = () => {
    const stats = seasonalStats.team_stats;
    return (
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Statistic</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
          {Object.entries(stats).map(([statName, value]) => (
            <tr key={statName}>
              <td>{statName}</td>
              <td>{value}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  // Render player stats as a table
  const renderPlayerStatsTable = () => {
    return (
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Player Name</th>
            <th>Position</th>
            <th>Points Total</th>
            <th>Points Avg</th>
            <th>Rebounds Total</th>
            <th>Rebounds Avg</th>
            <th>Assists Total</th>
            <th>Assists Avg</th>
          </tr>
        </thead>
        <tbody>
          {seasonalStats.player_stats.map((player) => (
            <tr key={player.player_id}>
              <td>{player.full_name}</td>
              <td>{player.position}</td>
              <td>{player.points_total}</td>
              <td>{player.points_avg}</td>
              <td>{player.rebounds_total}</td>
              <td>{player.rebounds_avg}</td>
              <td>{player.assists_total}</td>
              <td>{player.assists_avg}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  // Render schedule as a table
  const renderScheduleTable = () => {
    return (
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Date</th>
            <th>Home Team</th>
            <th>Away Team</th>
            <th>Status</th>
            <th>Home Points</th>
            <th>Away Points</th>
          </tr>
        </thead>
        <tbody>
          {schedule.games.map((game) => (
            <tr key={game.id}>
              <td>{new Date(game.scheduled).toLocaleDateString()}</td>
              <td>{game.home_team.name}</td>
              <td>{game.away_team.name}</td>
              <td>{game.status}</td>
              <td>{game.home_team.points || 'N/A'}</td>
              <td>{game.away_team.points || 'N/A'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  return (
    <div className="p-8">
      {/* Header with Title and Logo */}
      <div className="flex items-center mb-8">
        <h1 className="text-4xl font-bold mr-4">
          Vanderbilt Commodores Men's Basketball
        </h1>
        <img src={logo} alt="Vanderbilt Commodores Logo" className="w-20 h-20 object-contain" />
      </div>

      {/* Team Profile Section */}
      <section className="mb-8">
        <h2 className="text-2xl font-bold mb-4">Team Profile</h2>
        <p><strong>Alias:</strong> {teamProfile.alias}</p>
        <p><strong>Venue:</strong> {teamProfile.venue}</p>
        <p><strong>Conference:</strong> {teamProfile.conference}</p>
        {/* Add more profile details if desired */}
      </section>

      {/* Seasonal Team Stats Section */}
      <section className="mb-8">
        <h2 className="text-2xl font-bold mb-4">Seasonal Team Stats</h2>
        {renderTeamStatsTable()}
      </section>

      {/* Player Stats Section */}
      <section className="mb-8">
        <h2 className="text-2xl font-bold mb-4">Player Stats</h2>
        {seasonalStats.player_stats.length > 0 ? renderPlayerStatsTable() : <p>No player stats available</p>}
      </section>

      {/* Schedule Section */}
      <section className="mb-8">
        <h2 className="text-2xl font-bold mb-4">Schedule</h2>
        {schedule.games.length > 0 ? renderScheduleTable() : <p>No schedule available</p>}
      </section>
    </div>
  );
};

export default MensBasketballDashboard;
